import React, { useEffect, useState } from "react";
import "./css/style.css";
const Weather = () => {
  const [searchinfo, setsearchinfo] = useState("delhi");
  const changeInfo = async () => {
    try {
      let url = `api.openweathermap.org/data/2.5/weather?q=${searchinfo}
      &appid=c29282adf5a6b8701844d447e4b71786`;

      const res=fetch(url);
      const data=res.json();

    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    changeInfo();
  }, []);
  return (
    <>
      <div className="box">
        <div className="box-info">
          <input
            type="search"
            placeholder="search.."
            className="inp"
            value={searchinfo}
            onChange={(e) => {
              setsearchinfo(e.target.value);
            }}
          ></input>
          <button
            type="text"
            placeholder="search"
            className="btn"
            onClick={changeInfo}
          >
            Search
          </button>
        </div>
      </div>
      <article className="arc">
        <div className="inside-arc">
          <i className={"wi wi-day-sunny first-icon"}></i>
        </div>
        <div className="Temp">
          28.57
          <div className="status">
            Clouds
            <p className="para">Tokyo,jp</p>
          </div>
          <div className="date">{new Date().toLocaleString()}</div>
        </div>
        <div className="last-sec">
          <div className="icon">
            <i className="wi wi-day-sunny"></i>
            <div className="section">
              19:19 Pm
              <p>sunset</p>
            </div>
          </div>
          <div className="icon-2">
            <i className="wi wi-rain"></i>
            <div className="section">
              19:19 Pm
              <p>Rainy</p>
            </div>
          </div>
          <div className="icon-3">
            <i className="wi wi-humidity"></i>
            <div className="section">
              19:19 Pm
              <p>Humidity</p>
            </div>
          </div>

          <div className="icon-4">
            <i className="wi wi-strong-wind"></i>
            <div className="section">
              19:19 Pm
              <p>wind</p>
            </div>
          </div>
        </div>
      </article>
    </>
  );
};
export default Weather;

